import React, { useEffect } from "react";
import { FC } from "react";

interface Props {}

const WaterPrint: FC<Props> = () => {
  function canvasVm({
    container = document.body,
    width = "300px",
    font = "20px Microsoft Yahei",

    height = "200px",
    content = "水印",
  } = {}) {
    const arg = arguments[0];
    const canvas = document.createElement("canvas");
    canvas.setAttribute("width", width);
    canvas.setAttribute("height", height);
    const context = canvas.getContext("2d");
    context.textAlign = "center";
    context.font = font;
    context.rotate((Math.PI / 180) * 45);
    context.fillText(content, parseFloat(width) / 2, parseFloat(height) / 2);
    const base64Url = canvas.toDataURL();
    const vm = document.createElement("div");
    const stylStr = ` position:absolute;
                  top:0;
                  left:0;
                  bottom:0;
                  right:0;z-index:1000;
                  background-repeat:repeat;
                  background-image:url(${base64Url});
                  `;
    vm.setAttribute("style", stylStr);
    console.log(container);
    container.appendChild(vm);
  }

  useEffect(() => {
    // const container = document.getElementById("wrapper");
    // canvasVm({ container });
    var originalData;
    var ctx = document.getElementById("canvas").getContext("2d");
    var ctxText = document.getElementById("canvasText").getContext("2d");
    function hidden() {
      var textData;
      ctxText.font = "30px Microsoft Yahei";
      ctxText.fillText("水印", 60, 130);
      textData = ctxText.getImageData(
        0,
        0,
        ctxText.canvas.width,
        ctxText.canvas.height,
      ).data;

      var img = new Image();
      img.src =
        "https://img0.baidu.com/it/u=2073893958,4257886876&fm=253&fmt=auto&app=138&f=JPEG?w=500&h=500";

      img.onload = function () {
        ctx.drawImage(img, 0, 0);
        // 获取指定区域的canvas像素信息
        originalData = ctx.getImageData(
          0,
          0,
          ctx.canvas.width,
          ctx.canvas.height,
        );
        console.log(originalData);
        mergeData(textData, "R");
        console.log("sss", document.getElementById("canvas").toDataURL());
      };
      img.crossOrigin = "Anonymous";
      return { ctx, img, originalData };
    }

    function show() {
      var ctx = document.getElementById("canvas").getContext("2d");
      var img = new Image();
      var originalData;
      img.onload = function () {
        ctx.drawImage(img, 0, 0);
        // 获取指定区域的canvas像素信息
        originalData = ctx.getImageData(
          0,
          0,
          ctx.canvas.width,
          ctx.canvas.height,
        );
        console.log(originalData);
        processData(originalData);
      };
      // var {ctx, img, originalData} = hidden();

      img.src =
        "data:image/png;base64,";
    }
    // hidden();
    show()
    var mergeData = function (newData, color) {
      var oData = originalData.data;
      var bit, offset;

      switch (color) {
        case "R":
          bit = 0;
          offset = 3;
          break;
        case "G":
          bit = 1;
          offset = 2;
          break;
        case "B":
          bit = 2;
          offset = 1;
          break;
      }

      for (var i = 0; i < oData.length; i++) {
        if (i % 4 == bit) {
          // 只处理目标通道
          if (newData[i + offset] === 0 && oData[i] % 2 === 1) {
            // 没有水印信息的像素，将其对应通道的值设置为偶数
            if (oData[i] === 255) {
              oData[i]--;
            } else {
              oData[i]++;
            }
          } else if (newData[i + offset] !== 0 && oData[i] % 2 === 0) {
            // 有水印信息的像素，将其对应通道的值设置为奇数
            if (oData[i] === 255) {
              oData[i]--;
            } else {
              oData[i]++;
            }
          }
        }
      }
      ctx.putImageData(originalData, 0, 0);
    };

    var processData = function (originalData) {
      var data = originalData.data;
      for (var i = 0; i < data.length; i++) {
        if (i % 4 == 0) {
          if (data[i] % 2 === 0) {
            data[i] = 0;
          } else {
            data[i] = 255;
          }
        } else if (i % 4 === 3) {
          // alpha通道不做处理
          continue;
        } else {
          // 关闭其他分量，不关闭也不影响答案，甚至更美观 o(^▽^)o
          // data[i] = 0;
        }
      }
      // 将结果绘制到画布
      ctx.putImageData(originalData, 0, 0);
    };
  }, []);
  return (
    <div id="wrapper" style={{ position: "relative", display: "inline-flex" }}>
      {/*<img*/}
      {/*  style={{ position: "relative" }}*/}
      {/*  src="https://img0.baidu.com/it/u=2073893958,4257886876&fm=253&fmt=auto&app=138&f=JPEG?w=500&h=500"*/}
      {/*  alt=""*/}
      {/*/>*/}
      <canvas id="canvasText" width="256" height="256"></canvas>
      <canvas id="canvas" width="256" height="256"></canvas>
    </div>
  );
};

export default WaterPrint;
